import db from '../public/db.json'

const MainPage = ({ data }) => {
    // console.log(data)
    return (
        <div>
           <pre>
               {JSON.stringify(data, null, 4)}
           </pre>
        </div>
    )

}

MainPage.getInitialProps = (ctx) => {
    const fetchedData = db;
    return {data : fetchedData}
}

export default MainPage
